('F00*', 'F00-F09', 'Dementia in Alzheimers disease (G30.-+)', '', '', '', '', 'note : Alzheimers disease is a primary degenerative cerebral disease of unknown etiology with characteristic neuropathological and neurochemical features. The disorder is usually insidious in onset and develops slowly but steadily over a period of severa', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F00.0*', 'F00-F09', 'Dementia in Alzheimers disease with early onset (G30.0+)', '', '', '', '', 'note : Dementia in Alzheimers disease with onset before the age of 65, with a relatively rapid deteriorating course and with marked multiple disorders of the higher cortical functions. Alzheimers disease, type 2 Presenile dementia, Alzheimers type Prim', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F00.1*', 'F00-F09', 'Dementia in Alzheimers disease with late onset (G30.1+)', '', '', '', '', 'note : Dementia in Alzheimers disease with onset after the age of 65, usually in the late 7Os or thereafter, with a slow progression, and with memory impairment as the principal feature. Alzheimers disease, type 1 Primary degenerative dementia of the Al', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F00.2*', 'F00-F09', 'Dementia in Alzheimers disease, atypical or mixed type (G30', '', '', '', '', 'Atypical dementia, Alzheimers type', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
