('F01', 'F00-F09', 'Vascular dementia', 's:    arteriosclerot', '', '', '', 'Vascular dementia is the result of infarction of the brain due to vascular disease, including hypertensive cerebrovascular disease. The infarcts are usually small but cumulative in their effect. Onset is usually in later life.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F01.0', 'F00-F09', 'Vascular dementia of acute onset', '', '', '', '', 'Usually develops rapidly after a succession of strokes from cerebrovascular thrombosis, embolism or haemorrhage. In rare cases, a single large infarcation may be the cause.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F01.1', 'F00-F09', 'Multi-infarct dementia', '', '', '', '', 'Gradual in onset, following a number of transient ischaemic episodes which produce an accumulation of infarcts in the cerebral parenchyma. Predominantly cortical dementia', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F01.2', 'F00-F09', 'Subcortical vascular dementia', '', '', '', '', 'Includes cases with a history of hypertension and foci of ischaemic destruction in the deep white matter of the cerebral hemispheres. The cerebral cortex is usually preserved and this contrasts with the clinical picture which may closely resemble that of ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F01.3', 'F00-F09', 'Mixed cortical and subcortical vascular dementia', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F01.8', 'F00-F09', 'Other vascular dementia', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F01.9', 'F00-F09', 'Vascular dementia, unspecified', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F02*', 'F00-F09', 'Dementia in other diseases classified elsewhere', '', '', '', '', 'Cases of dementia due, or presumed to be due, to causes other than Alzheimers disease or cerebrovascular disease. Onset may be at any time in life, though rarely in old age.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F02.0*', 'F00-F09', 'Dementia in Picks disease (G31.0+)', '', '', '', '', 'A progressive dementia, commencing in middle age, characterized by early, slowly progressing changes of character and social deterioration, followed by impairment of intellect, memory, and language functions, with apathy, euphoria and, occasionally, extra', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F02.1*', 'F00-F09', 'Dementia in Creutzfeldt-Jakob disease (A81.0+)', '', '', '', '', 'A progressive dementia with extensive neurological signs, due to specific neuropathological changes that are presumed to be caused by a transmissible agent. Onset is usually in middle or later life, but may be at any adult age. The course is subacute, lea', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F02.2*', 'F00-F09', 'Dementia in Huntingtons disease (G10+)', '', '', '', '', 'A dementia occurring as part of a widespread degeneration of the brain. The disorder is transmitted by a single autosomal dominant gene. Symptoms typically emerge in the third and fourth decade. Progression is slow, leading to death usually within 10 to 1', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F02.3*', 'F00-F09', 'Dementia in Parkinsons disease (G20+)', '', '', '', '', 'A dementia developing in the course of established Parkinsons disease. No particular distinguishing clinical features have yet been demonstrated. Dementia in: . paralysis agitans . parkinsonism', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F02.4*', 'F00-F09', 'Dementia in human immunodeficiency virus [HIV] disease (B22.', '', '', '', '', 'Dementia developing in the course of HIV disease, in the absence of a concurrent illness or condition other than HIV infection that could explain the clinical features.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F02.8*', 'F00-F09', 'Dementia in other specified diseases classified elsewhere', '', '', '', '', 'Dementia in: . cerebral lipidosis (E75.-+) . epilepsy (G40.-+) . hepatolenticular degeneration (E83.0+) . hypercalcaemia (E83.5+) . hypothyroidism, acquired (E01, E03.-+) . intoxications (T36-T65+) . multiple sclerosis (G35+) . neurosyphilis (A52.1+) . ni', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
