('F05', 'F00-F09', 'Delirium, not induced by alcohol and other psychoactive subs', 's:    acute or subac', 'acterized by concurr', '', '', 'An etiologically nonspecific organic cerebral syndrome characterized by concurrent disturbances of consciousness and attention, perception, thinking, memory, psychomotor behaviour, emotion, and the sleep-wake schedule. The duration is variable and the deg', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
