('F06.0', 'F00-F09', 'Organic hallucinosis', '', 'sually visual or aud', '', '', 'A disorder of persistent or recurrent hallucinations, usually visual or auditory, that occur in clear consciousness and may or may not be recognized by the subject as such. Delusional elaboration of the hallucinations may occur, but delusions do not domin', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F06.1', 'F00-F09', 'Organic catatonic disorder', '', 'y associated with ca', '', '', 'A disorder of diminished (stupor) or increased (excitement) psychomotor activity associated with catatonic symptoms. The extremes of psychomotor disturbance may alternate.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F06.2', 'F00-F09', 'Organic delusional [schizophrenia-like] disorder', '', 'renia, such as bizar', '', '', 'A disorder in which persistent or recurrent delusions dominate the clinical picture. The delusions may be accompanied by hallucinations. Some features suggestive of schizophrenia, such as bizarre hallucinations or thought disorder, may be present. Paranoi', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
