('F06.4', 'F00-F09', 'Organic anxiety disorder', '', 'eatures of a general', '', '', 'A disorder characterized by the essential descriptive features of a generalized anxiety disorder (F41.1), a panic disorder (F41.0), or a combination of both, but arising as a consequence of an organic disorder.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F06.5', 'F00-F09', 'Organic dissociative disorder', '', 'gration between memo', '', '', 'A disorder characterized by a partial or complete loss of the normal integration between memories of the past, awareness of identity and immediate sensations, and control of bodily movements (see F44.-), but arising as a consequence of an organic disorder', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F06.6', 'F00-F09', 'Organic emotionally labile [asthenic] disorder', '', 'lity, fatigability, ', '', '', 'A disorder characterized by emotional incontinence or lability, fatigability, and a variety of unpleasant physical sensations (e.g. dizziness) and pains, but arising as a consequence of an organic disorder.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F06.7', 'F00-F09', 'Mild cognitive disorder', '', '', '', '', 'A disorder characterized by impairment of memory, learning difficulties, and reduced ability to concentrate on a task for more than brief periods.  There is often a marked feeling of mental fatigue when mental tasks are attempted, and new learning is foun', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
