('F20', 'F20-F29', 'Schizophrenia', '', '', '', '', 'The schizophrenic disorders are characterized in general by fundamental and characteristic distortions of thinking and perception, and affects that are inappropriate or blunted. Clear consciousness and intellectual capacity are usually maintained although', 1, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F20.0', 'F20-F29', 'Paranoid schizophrenia', '', 'e, often paranoid de', '', '', 'Paranoid schizophrenia is dominated by relatively stable, often paranoid delusions, usually accompanied by hallucinations, particularly of the auditory variety, and perceptual disturbances. Disturbances of affect, volition and speech, and catatonic sympto', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F20.1', 'F20-F29', 'Hebephrenic schizophrenia', '', '', '', '', 'A form of schizophrenia in which affective changes are prominent, delusions and hallucinations fleeting and fragmentary, behaviour irresponsible and unpredictable, and mannerisms common. The mood is shallow and inappropriate, thought is disorganized, and ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F20.2', 'F20-F29', 'Catatonic schizophrenia', '', '', '', '', 'Catatonic schizophrenia is dominated by prominent psychomotor disturbances that may alternate between extremes such as hyperkinesis and stupor, or automatic obedience and negativism. Constrained attitudes and postures may be maintained for long periods. E', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F20.3', 'F20-F29', 'Undifferentiated schizophrenia', '', 'exhibiting the featu', '', '', 'Psychotic conditions meeting the general diagnostic criteria for schizophrenia but not conforming to any of the subtypes in F20.0-F20.2, or exhibiting the features of more than one of them without a clear predominance of a particular set of diagnostic cha', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F20.4', 'F20-F29', 'Post-schizophrenic depression', '', '', '', '', 'A depressive episode, which may be prolonged, arising in the aftermath of a schizophrenic illness. Some schizophrenic symptoms, either "positive" or "negative", must still be present but they no longer dominate the clinical picture. These depressive state', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F20.5', 'F20-F29', 'Residual schizophrenia', '', '', '', '', 'A chronic stage in the development of a schizophrenic illness in which there has been a clear progression from an early stage to a later stage characterized by long- term, though not necessarily irreversible, "negative" symptoms, e.g. psychomotor slowing;', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F20.6', 'F20-F29', 'Simple schizophrenia', '', '', '', '', 'A disorder in which there is an insidious but progressive development of oddities of conduct, inability to meet the demands of society, and decline in total performance. The characteristic negative features of residual schizophrenia (e.g. blunting of affe', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F20.8', 'F20-F29', 'Other schizophrenia', '', 'rm: . disorder NOS .', '', '', 'Cenesthopathic schizophrenia Schizophreniform: . disorder NOS . psychosis NOS', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F20.9', 'F20-F29', 'Skizofrenia, tidak spesifik', '', '', '', '', '', 1, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F21', 'F20-F29', 'Schizotypal disorder', '', 'nking and affect whi', '', '', 'A disorder characterized by eccentric behaviour and anomalies of thinking and affect which resemble those seen in schizophrenia, though no definite and characteristic schizophrenic anomalies occur at any stage. The symptoms may include a cold or inappropr', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F22', 'F20-F29', 'Persistent delusional disorders', '', '', '', '', 'Includes a variety of disorders in which long-standing delusions constitute the only, or the most conspicuous, clinical characteristic and which cannot be classified as organic, schizophrenic or affective. Delusional disorders that have lasted for less th', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F22.0', 'F20-F29', 'Delusional disorder', '', 'ly persistent and so', '', '', 'A disorder characterized by the development either of a single delusion or of a set of related delusions that are usually persistent and sometimes lifelong. The content of the delusion or delusions is very variable. Clear and persistent auditory hallucina', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F22.8', 'F20-F29', 'Other persistent delusional disorders', '', '', '', '', 'Disorders in which the delusion or delusions are accompanied by persistent hallucinatory voices or by schizophrenic symptoms that do not justify a diagnosis of schizophrenia (F20.-). Delusional dysmorphophobia Involutional paranoid state Paranoia querulan', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F22.9', 'F20-F29', 'Persistent delusional disorder, unspecified', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F23', 'F20-F29', 'Acute and transient psychotic disorders', '', '', '', '', 'A heterogeneous group of disorders characterized by the acute onset of psychotic symptoms such as delusions, hallucinations, and perceptual disturbances, and by the severe disruption of ordinary behaviour. Acute onset is defined as a crescendo development', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F23.0', 'F20-F29', 'Acute polymorphic psychotic disorder without symptoms of sch', '', '', '', '', 'An acute psychotic disorder in which hallucinations, delusions or perceptual disturbances are obvious but markedly variable, changing from day to day or even from hour to hour. Emotional turmoil with intense transient feelings of happiness or ecstasy, or ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F23.1', 'F20-F29', 'Acute polymorphic psychotic disorder with symptoms of schizo', '', '', '', '', 'An acute psychotic disorder in which the polymorphic and unstable clinical picture is present, as described in F23.0; despite this instability, however, some symptoms typical of schizophrenia are also in evidence for the majority of the time. If the schiz', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F23.2', 'F20-F29', 'Acute schizophrenia-like psychotic disorder', '', 'diagnosis of schizop', '', '', 'An acute psychotic disorder in which the psychotic symptoms are comparatively stable and justify a diagnosis of schizophrenia, but have lasted for less than about one month; the polymorphic unstable features, as described in F23.0, are absent. If the schi', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F23.3', 'F20-F29', 'Other acute predominantly delusional psychotic disorders', '', '', '', '', 'Acute psychotic disorders in which comparatively stable delusions or hallucinations are the main clinical features, but do not justify a diagnosis of schizophrenia (F20.-). If the delusions persist the diagnosis should be changed to persistent delusional ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F23.8', 'F20-F29', 'Other acute and transient psychotic disorders', '', '', '', '', 'Any other specified acute psychotic disorders for which there is no evidence of organic causation and which do not justify classification to F23.0-F23.3.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F23.9', 'F20-F29', 'Acute and transient psychotic disorder, unspecified', '', '', '', '', 'Brief reactive psychosis NOS Reactive psychosis', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F24', 'F20-F29', 'Induced delusional disorder', '', '', '', '', 'A delusional disorder shared by two or more people with close emotional links. Only one of the people suffers from a genuine psychotic disorder; the delusions are induced in the other(s) and usually disappear when the people are separated. Folie … deux In', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F25', 'F20-F29', 'Schizoaffective disorders', '', '', '', '', 'Episodic disorders in which both affective and schizophrenic symptoms are prominent but which do not justify a diagnosis of either schizophrenia or depressive or manic episodes. Other conditions in which affective symptoms are superimposed on a pre-existi', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F25.0', 'F20-F29', 'Schizoaffective disorder, manic type', '', '', '', '', 'A disorder in which both schizophrenic and manic symptoms are prominent so that the episode of illness does not justify a diagnosis of either schizophrenia or a manic episode. This category should be used for both a single episode and a recurrent disorder', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F25.1', 'F20-F29', 'Schizoaffective disorder, depressive type', '', '', '', '', 'A disorder in which both schizophrenic and depressive symptoms are prominent so that the episode of illness does not justify a diagnosis of either schizophrenia or a depressive episode. This category should be used for both a single episode and a recurren', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F25.2', 'F20-F29', 'Schizoaffective disorder, mixed type', '', '', '', '', 'Cyclic schizophrenia Mixed schizophrenic and affective psychosis', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F25.8', 'F20-F29', 'Other schizoaffective disorders', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
