('F28', 'F20-F29', 'Other nonorganic psychotic disorders', '', '', '', '', 'Delusional or hallucinatory disorders that do not justify a diagnosis of schizophrenia (F20.-), persistent delusional disorders (F22.-), acute and transient psychotic disorders (F23.-), psychotic types of manic episode (F30.2), or severe depressive episod', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F29', 'F20-F29', 'Unspecified nonorganic psychosis', '', 'atic psychosis NOS (', '', '', 'Psychosis NOS', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F30', 'F30-F39', 'Manic episode', 's:  bipolar disorder', '', '', '', 'All the subdivisions of this category should be used only for a single episode. Hypomanic or manic episodes in individuals who have had one or more previous affective episodes (depressive, hypomanic, manic, or mixed) should be coded as bipolar affective d', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F30.0', 'F30-F39', 'Hypomania', '', '', '', '', 'A disorder characterized by a persistent mild elevation of mood, increased energy and activity, and usually marked feelings of well-being and both physical and mental efficiency. Increased sociability, talkativeness, over-familiarity, increased sexual ene', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F30.1', 'F30-F39', 'Mania without psychotic symptoms', '', '', '', '', 'Mood is elevated out of keeping with the patients circumstances and may vary from carefree joviality to almost uncontrollable excitement. Elation is accompanied by increased energy, resulting in overactivity, pressure of speech, and a decreased need for ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F30.2', 'F30-F39', 'Mania with psychotic symptoms', '', '', '', '', 'In addition to the clinical picture described in F30.1, delusions (usually grandiose) or hallucinations (usually of voices speaking directly to the patient) are present, or the excitement, excessive motor activity, and flight of ideas are so extreme that ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F30.8', 'F30-F39', 'Other manic episodes', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F30.9', 'F30-F39', 'Manic episode, unspecified', '', '', '', '', 'Mania NOS', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F31', 'F30-F39', 'Bipolar affective disorder', 's:  manic-depressive', 'nts mood and activi', '', '', 'A disorder characterized by two or more episodes in which the patients mood and activity levels are significantly disturbed, this disturbance consisting on some occasions of an elevation of mood and increased energy and activity (hypomania or mania) and ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F31.0', 'F30-F39', 'Bipolar affective disorder, current episode hypomanic', '', '', '', '', 'The patient is currently hypomanic, and has had at least one other affective episode (hypomanic, manic, depressive, or mixed) in the past.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F31.1', 'F30-F39', 'Bipolar affective disorder, current episode manic without ps', '', '', '', '', 'The patient is currently manic, without psychotic symptoms (as in F30.1), and has had at least one other affective episode (hypomanic, manic, depressive, or mixed) in the past.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F31.2', 'F30-F39', 'Bipolar affective disorder, current episode manic with psych', '', '', '', '', 'The patient is currently manic, with psychotic symptoms (as in F30.2), and has had at least one other affective episode (hypomanic, manic, depressive, or mixed) in the past.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F31.3', 'F30-F39', 'Bipolar affective disorder, current episode mild or moderate', '', '', '', '', 'The patient is currently depressed, as in a depressive episode of either mild or moderate severity (F32.0 or F32.1), and has had at least one authenticated hypomanic, manic, or mixed affective episode in the past.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F31.4', 'F30-F39', 'Bipolar affective disorder, current episode severe depressio', '', '', '', '', 'The patient is currently depressed, as in severe depressive episode without psychotic symptoms (F32.2), and has had at least one authenticated hypomanic, manic, or mixed affective episode in the past.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F31.5', 'F30-F39', 'Bipolar affective disorder, current episode severe depressio', '', '', '', '', 'The patient is currently depressed, as in severe depressive episode with psychotic symptoms (F32.3), and has had at least one authenticated hypomanic, manic, or mixed affective episode in the past.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F31.6', 'F30-F39', 'Bipolar affective disorder, current episode mixed', '', 'ticated hypomanic, m', '', '', 'The patient has had at least one authenticated hypomanic, manic, depressive, or mixed affective episode in the past, and currently exhibits either a mixture or a rapid alteration of manic and depressive symptoms.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F31.7', 'F30-F39', 'Bipolar affective disorder, currently in remission', '', '', '', '', 'The patient has had at least one authenticated hypomanic, manic, or mixed affective episode in the past, and at least one other affective episode (hypomanic, manic, depressive, or mixed) in addition, but is not currently suffering from any significant moo', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F31.8', 'F30-F39', 'Other bipolar affective disorders', '', '', '', '', 'Bipolar II disorder Recurrent manic episodes', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F31.9', 'F30-F39', 'Bipolar affective disorder, unspecified', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F32', 'F30-F39', 'Depressive episode', 's:  single episodes ', '', '', '', 'In typical mild, moderate, or severe depressive episodes, the patient suffers from lowering of mood, reduction of energy, and decrease in activity. Capacity for enjoyment, interest, and concentration is reduced, and marked tiredness after even minimum eff', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F32.0', 'F30-F39', 'Mild depressive episode', '', '', '', '', 'Two or three of the above symptoms are usually present. The patient is usually distressed by these but will probably be able to continue with most activities.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F32.1', 'F30-F39', 'Moderate depressive episode', '', '', '', '', 'Four or more of the above symptoms are usually present and the patient is likely to have great difficulty in continuing with ordinary activities.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F32.2', 'F30-F39', 'Severe depressive episode without psychotic symptoms', '', '', '', '', 'An episode of depression in which several of the above symptoms are marked and distressing, typically loss of self-esteem and ideas of worthlessness or guilt. Suicidal thoughts and acts are common and a number of "somatic" symptoms are usually present. Ag', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F32.3', 'F30-F39', 'Severe depressive episode with psychotic symptoms', '', '', '', '', 'An episode of depression as described in F32.2, but with the presence of hallucinations, delusions, psychomotor retardation, or stupor so severe that ordinary social activities are impossible; there may be danger to life from suicide, dehydration, or star', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F32.8', 'F30-F39', 'Other depressive episodes', '', '', '', '', 'Atypical depression Single episodes of "masked" depression NOS', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F32.9', 'F30-F39', 'Depressive episode, unspecified', '', '', '', '', 'Depression NOS Depressive disorder NOS', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F33', 'F30-F39', 'Recurrent depressive disorder', '', '', '', '', 'A disorder characterized by repeated episodes of depression as described for depressive episode (F32.-), without any history of independent episodes of mood elevation and increased energy (mania). There may, however, be brief episodes of mild mood elevati', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F33.0', 'F30-F39', 'Recurrent depressive disorder, current episode mild', '', '', '', '', 'A disorder characterized by repeated episodes of depression, the current episode being mild, as in F32.0, and without any history of mania.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F33.1', 'F30-F39', 'Recurrent depressive disorder, current episode moderate', '', '', '', '', 'A disorder characterized by repeated episodes of depression, the current episode being of moderate severity, as in F32.1, and without any history of mania.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F33.2', 'F30-F39', 'Recurrent depressive disorder, current episode severe withou', '', '', '', '', 'A disorder characterized by repeated episodes of depression, the current episode being severe without psychotic symptoms, as in F32.2, and without any history of mania. Endogenous depression without psychotic symptoms Major depression, recurrent without p', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F33.3', 'F30-F39', 'Recurrent depressive disorder, current episode severe with p', '', '', '', '', 'A disorder characterized by repeated episodes of depression, the current episode being severe with psychotic symptoms, as in F32.3, and with no previous episodes of mania. Endogenous depression with psychotic symptoms Manic-depressive psychosis, depressed', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F33.4', 'F30-F39', 'Recurrent depressive disorder, currently in remission', '', '', '', '', 'The patient has had two or more depressive episodes as described in F33.0-F33.3, in the past, but has been free from depressive symptoms for several months.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F33.8', 'F30-F39', 'Other recurrent depressive disorders', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
