('F34', 'F30-F39', 'Persistent mood [affective] disorders', '', '', '', '', 'Persistent and usually fluctuating disorders of mood in which the majority of the individual episodes are not sufficiently severe to warrant being described as hypomanic or mild depressive episodes. Because they last for many years, and sometimes for the ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F34.0', 'F30-F39', 'Cyclothymia', '', '', '', '', 'A persistent instability of mood involving numerous periods of depression and mild elation, none of which is sufficiently severe or prolonged to justify a diagnosis of bipolar affective disorder (F31.-) or recurrent depressive disorder (F33.-). This disor', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F34.1', 'F30-F39', 'Dysthymia', '', 'al years, which is n', '', '', 'A chronic depression of mood, lasting at least several years, which is not sufficiently severe, or in which individual episodes are not sufficiently prolonged, to justify a diagnosis of severe, moderate, or mild recurrent depressive disorder (F33.-). Depr', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
