('F38', 'F30-F39', 'Other mood [affective] disorders', '', '', '', '', 'Any other mood disorders that do not justify classification to F30-F34, because they are not of sufficient severity or duration.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F38.0', 'F30-F39', 'Other single mood [affective] disorders', '', '', '', '', 'Mixed affective episode', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
