('F40', 'F40-F48', 'Phobic anxiety disorders', '', '', '', '', 'A group of disorders in which anxiety is evoked only, or predominantly, in certain well-defined situations that are not currently dangerous. As a result these situations are characteristically avoided or endured with dread. The patients concern may be fo', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F40.0', 'F40-F48', 'Agoraphobia', '', '', '', '', 'A fairly well-defined cluster of phobias embracing fears of leaving home, entering shops, crowds and public places, or travelling alone in trains, buses or planes. Panic disorder is a frequent feature of both present and past episodes. Depressive and obse', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F40.1', 'F40-F48', 'Social phobias', '', '', '', '', 'Fear of scrutiny by other people leading to avoidance of social situations. More pervasive social phobias are usually associated with low self-esteem and fear of criticism. They may present as a complaint of blushing, hand tremor, nausea, or urgency of mi', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F40.2', 'F40-F48', 'Specific (isolated) phobias', '', 'oximity to particula', '', '', 'Phobias restricted to highly specific situations such as proximity to particular animals, heights, thunder, darkness, flying, closed spaces, urinating or defecating in public toilets, eating certain foods, dentistry, or the sight of blood or injury. Thoug', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F40.8', 'F40-F48', 'Other phobic anxiety disorders', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F40.9', 'F40-F48', 'Phobic anxiety disorder, unspecified', '', '', '', '', 'Phobia NOS Phobic state NOS', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F41', 'F40-F48', 'Other anxiety disorders', '', '', '', '', 'Disorders in which manifestation of anxiety is the major symptom and is not restricted to any particular environmental situation. Depressive and obsessional symptoms, and even some elements of phobic anxiety, may also be present, provided that they are cl', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F41.0', 'F40-F48', 'Panic disorder [episodic paroxysmal anxiety]', '', 'ks of severe anxiety', '', '', 'The essential feature is recurrent attacks of severe anxiety (panic), which are not restricted to any particular situation or set of circumstances and are therefore unpredictable. As with other anxiety disorders, the dominant symptoms include sudden onset', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F41.1', 'F40-F48', 'Generalized anxiety disorder', '', 'alized and persisten', '', '', 'Anxiety that is generalized and persistent but not restricted to, or even strongly predominating in, any particular environmental circumstances (i.e. it is "free-floating"). The dominant symptoms are variable but include complaints of persistent nervousne', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F41.2', 'F40-F48', 'Mixed anxiety and depressive disorder', '', '', '', '', 'This category should be used when symptoms of anxiety and depression are both present, but neither is clearly predominant, and neither type of symptom is present to the extent that justifies a diagnosis if considered separately. When both anxiety and depr', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F41.3', 'F40-F48', 'Other mixed anxiety disorders', '', '', '', '', 'Symptoms of anxiety mixed with features of other disorders in F42-F48. Neither type of symptom is severe enough to justify a diagnosis if considered separately.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F41.8', 'F40-F48', 'Other specified anxiety disorders', '', '', '', '', 'Anxiety hysteria', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F41.9', 'F40-F48', 'Anxiety disorder, unspecified', '', '', '', '', 'Anxiety NOS', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F42', 'F40-F48', 'Obsessive-compulsive disorder', 's:  an', '', '', '', 'The essential feature is recurrent obsessional thoughts or compulsive acts. Obsessional thoughts are ideas, images, or impulses that enter the patients mind again and again in a stereotyped form. They are almost invariably distressing and the patient oft', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F42.0', 'F40-F48', 'Predominantly obsessional thoughts or ruminations', '', '', '', '', 'These may take the form of ideas, mental images, or impulses to act, which are nearly always distressing to the subject. Sometimes the ideas are an indecisive, endless consideration of alternatives, associated with an inability to make trivial but necessa', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F42.1', 'F40-F48', 'Predominantly compulsive acts [obsessional rituals]', '', '', '', '', 'The majority of compulsive acts are concerned with cleaning (particularly handwashing), repeated checking to ensure that a potentially dangerous situation has not been allowed to develop, or orderliness and tidiness. Underlying the overt behaviour is a fe', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F42.2', 'F40-F48', 'Mixed obsessional thoughts and acts', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F42.8', 'F40-F48', 'Other obsessive-compulsive disorders', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F42.9', 'F40-F48', 'Obsessive-compulsive disorder, unspecified', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F43', 'F40-F48', 'Reaction to severe stress, and adjustment disorders', '', '', '', '', 'This category differs from others in that it includes disorders identifiable on the basis of not only symptoms and course but also the existence of one or other of two causative influences: an exceptionally stressful life event producing an acute stress r', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F43.0', 'F40-F48', 'Acute stress reaction', '', '', '', '', 'A transient disorder that develops in an individual without any other apparent mental disorder in response to exceptional physical and mental stress and that usually subsides within hours or days. Individual vulnerability and coping capacity play a role i', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F43.1', 'F40-F48', 'Post-traumatic stress disorder', '', '', '', '', 'Arises as a delayed or protracted response to a stressful event or situation (of either brief or long duration) of an exceptionally threatening or catastrophic nature, which is likely to cause pervasive distress in almost anyone. Predisposing factors, suc', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F43.2', 'F40-F48', 'Adjustment disorders', '', '', '', '', 'States of subjective distress and emotional disturbance, usually interfering with social functioning and performance, arising in the period of adaptation to a significant life change or a stressful life event. The stressor may have affected the integrity ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F43.8', 'F40-F48', 'Other reactions to severe stress', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F43.9', 'F40-F48', 'Reaction to severe stress, unspecified', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F44', 'F40-F48', 'Dissociative [conversion] disorders', '', '', '', '', 'The common themes that are shared by dissociative or conversion disorders are a partial or complete loss of the normal integration between memories of the past, awareness of identity and immediate sensations, and control of bodily movements. All types of ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F44.0', 'F40-F48', 'Dissociative amnesia', '', 'or unexpected bereav', '', '', 'The main feature is loss of memory, usually of important recent events, that is not due to organic mental disorder, and is too great to be explained by ordinary forgetfulness or fatigue. The amnesia is usually centred on traumatic events, such as accident', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F44.1', 'F40-F48', 'Dissociative fugue', '', 'res of dissociative ', '', '', 'Dissociative fugue has all the features of dissociative amnesia, plus purposeful travel beyond the usual everyday range. Although there is amnesia for the period of the fugue, the patients behaviour during this time may appear completely normal to indepe', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F44.2', 'F40-F48', 'Dissociative stupor', '', 'esponsiveness to ext', '', '', 'Dissociative stupor is diagnosed on the basis of a profound diminution or absence of voluntary movement and normal responsiveness to external stimuli such as light, noise, and touch, but examination and investigation reveal no evidence of a physical cause', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F44.3', 'F40-F48', 'Trance and possession disorders', '', 'des:  states associa', '', '', 'Disorders in which there is a temporary loss of the sense of personal identity and full awareness of the surroundings. Include here only trance states that are involuntary or unwanted, occurring outside religious or culturally accepted situations.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F44.4', 'F40-F48', 'Dissociative motor disorders', '', '', '', '', 'In the commonest varieties there is loss of ability to move the whole or a part of a limb or limbs. There may be close resemblance to almost any variety of ataxia, apraxia, akinesia, aphonia, dysarthria, dyskinesia, seizures, or paralysis. Psychogenic: . ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F44.5', 'F40-F48', 'Dissociative convulsions', '', '', '', '', 'Dissociative convulsions may mimic epileptic seizures very closely in terms of movements, but tongue-biting, bruising due to falling, and incontinence of urine are rare, and consciousness is maintained or replaced by a state of stupor or trance.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F44.6', 'F40-F48', 'Dissociative anaesthesia and sensory loss', '', '', '', '', 'Anaesthetic areas of skin often have boundaries that make it clear that they are associated with the patients ideas about bodily functions, rather than medical knowledge. There may be differential loss between the sensory modalities which cannot be due t', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F44.7', 'F40-F48', 'Mixed dissociative [conversion] disorders', '', '', '', '', 'Combination of disorders specified in F44.0-F44.6', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F44.8', 'F40-F48', 'Other dissociative [conversion] disorders', '', '', '', '', 'Gansers syndrome Multiple personality Psychogenic: . confusion . twilight state', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F44.9', 'F40-F48', 'Dissociative [conversion] disorder, unspecified', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F45', 'F40-F48', 'Somatoform disorders', '', 'disorders (F44.-) ha', '', '', 'The main feature is repeated presentation of physical symptoms together with persistent requests for medical investigations, in spite of repeated negative findings and reassurances by doctors that the symptoms have no physical basis. If any physical disor', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F45.0', 'F40-F48', 'Somatization disorder', '', 'nd frequently changi', '', '', 'The main features are multiple, recurrent and frequently changing physical symptoms of at least two years duration. Most patients have a long and complicated history of contact with both primary and specialist medical care services, during which many neg', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F45.1', 'F40-F48', 'Undifferentiated somatoform disorder', '', '', '', '', 'When somatoform complaints are multiple, varying and persistent, but the complete and typical clinical picture of somatization disorder is not fulfilled, the diagnosis of undifferentiated somatoform disorder should be considered. Undifferentiated psychoso', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F45.2', 'F40-F48', 'Hypochondriacal disorder', '', 'ore serious and prog', '', '', 'The essential feature is a persistent preoccupation with the possibility of having one or more serious and progressive physical disorders. Patients manifest persistent somatic complaints or a persistent preoccupation with their physical appearance. Normal', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00');
INSERT INTO `mst_icd` (`KD_PENYAKIT`, `KD_ICD_INDUK`, `PENYAKIT`, `INCLUDES`, `EXCLUDES`, `NOTES`, `STATUS_APP`, `DESCRIPTION`, `IS_DEFAULT`, `IS_ODONTOGRAM`, `ninput_oleh`, `ninput_tgl`, `nupdate_oleh`, `nupdate_tgl`) VALUES
('F45.3', 'F40-F48', 'Somatoform autonomic dysfunction', '', '', '', '', 'Symptoms are presented by the patient as if they were due to a physical disorder of a system or organ that is largely or completely under autonomic innervation and control, i.e. the cardiovascular, gastrointestinal, respiratory and urogenital systems. The', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F45.4', 'F40-F48', 'Persistent somatoform pain disorder', '', 'al process or a phys', '', '', 'The predominant complaint is of persistent, severe, and distressing pain, which cannot be explained fully by a physiological process or a physical disorder, and which occurs in association with emotional conflict or psychosocial problems that are sufficie', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F45.8', 'F40-F48', 'Other somatoform disorders', '', '', '', '', 'Any other disorders of sensation, function and behaviour, not due to physical disorders, which are not mediated through the autonomic nervous system, which are limited to specific systems or parts of the body, and which are closely associated in time with', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F45.9', 'F40-F48', 'Somatoform disorder, unspecified', '', '', '', '', 'Psychosomatic disorder NOS', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F48', 'F40-F48', 'Other neurotic disorders', '', '', '', '', '', 1, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F48.0', 'F40-F48', 'Neurasthenia', '', '', '', '', 'Considerable cultural variations occur in the presentation of this disorder, and two main types occur, with substantial overlap. In one type, the main feature is a complaint of increased fatigue after mental effort, often associated with some decrease in ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F48.1', 'F40-F48', 'Depersonalization-derealization syndrome', '', '', '', '', 'A rare disorder in which the patient complains spontaneously that his or her mental activity, body, and surroundings are changed in their quality, so as to be unreal, remote, or automatized. Among the varied phenomena of the syndrome, patients complain mo', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F48.8', 'F40-F48', 'Other specified neurotic disorders', '', '', '', '', 'Briquets disorder Dhat syndrome Occupational neurosis, including writers cramp Psychasthenia Psychasthenic neurosis Psychogenic syncope', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F48.9', 'F40-F48', 'Gangguan emosi (neurotik) lainnya', '', '', '', '', 'Neurosis NOS', 1, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F50', 'F50-F59', 'Eating disorders', '', 'ia (R63.2)', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F50.0', 'F50-F59', 'Anorexia nervosa', '', 'oss, induced and sus', '', '', 'A disorder characterized by deliberate weight loss, induced and sustained by the patient. It occurs most commonly in adolescent girls and young women, but adolescent boys and young men may also be affected, as may children approaching puberty and older wo', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F50.1', 'F50-F59', 'Atypical anorexia nervosa', '', '', '', '', 'Disorders that fulfil some of the features of anorexia nervosa but in which the overall clinical picture does not justify that diagnosis. For instance, one of the key symptoms, such as amenorrhoea or marked dread of being fat, may be absent in the presenc', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F50.2', 'F50-F59', 'Bulimia nervosa', '', '', '', '', 'A syndrome characterized by repeated bouts of overeating and an excessive preoccupation with the control of body weight, leading to a pattern of overeating followed by vomiting or use of purgatives. This disorder shares many psychological features with an', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F50.3', 'F50-F59', 'Atypical bulimia nervosa', '', '', '', '', 'Disorders that fulfil some of the features of bulimia nervosa, but in which the overall clinical picture does not justify that diagnosis. For instance, there may be recurrent bouts of overeating and overuse of purgatives without significant weight change,', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F50.4', 'F50-F59', 'Overeating associated with other psychological disturbances', '', 'o stressful events, ', '', '', 'Overeating due to stressful events, such as bereavement, accident, childbirth, etc. Psychogenic overeating', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F50.5', 'F50-F59', 'Vomiting associated with other psychological disturbances', '', 'dissociative disorde', '', '', 'Repeated vomiting that occurs in dissociative disorders (F44.-) and hypochondriacal disorder (F45.2), and that is not solely due to conditions classified outside this chapter. This subcategory may also be used in addition to O21.- (excessive vomiting in p', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F50.8', 'F50-F59', 'Other eating disorders', '', 'etite Excludes:  pic', '', '', 'Pica in adults Psychogenic loss of appetite', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F50.9', 'F50-F59', 'Eating disorder, unspecified', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F51', 'F50-F59', 'Nonorganic sleep disorders', '', 'eep is one of the sy', '', '', 'In many cases, a disturbance of sleep is one of the symptoms of another disorder, either mental or physical. Whether a sleep disorder in a given patient is an independent condition or simply one of the features of another disorder classified elsewhere, ei', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F51.0', 'F50-F59', 'Nonorganic insomnia', '', 'ry quantity and/or q', '', '', 'A condition of unsatisfactory quantity and/or quality of sleep, which persists for a considerable period of time, including difficulty falling asleep, difficulty staying asleep, or early final wakening. Insomnia is a common symptom of many mental and phys', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F51.1', 'F50-F59', 'Nonorganic hypersomnia', '', 'xcessive daytime sle', '', '', 'Hypersomnia is defined as a condition of either excessive daytime sleepiness and sleep attacks (not accounted for by an inadequate amount of sleep) or prolonged transition to the fully aroused state upon awakening. In the absence of an organic factor for ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F51.2', 'F50-F59', 'Nonorganic disorder of the sleep-wake schedule', '', 'the desired sleep-wa', '', '', 'A lack of synchrony between the sleep-wake schedule and the desired sleep-wake schedule for the individuals environment, resulting in a complaint of either insomnia or hypersomnia. Psychogenic inversion of: . circadian    ) . nyctohemeral ) rhythm . slee', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F51.3', 'F50-F59', 'Sleepwalking [somnambulism]', '', '', '', '', 'A state of altered consciousness in which phenomena of sleep and wakefulness are combined. During a sleepwalking episode the individual arises from bed, usually during the first third of nocturnal sleep, and walks about, exhibiting low levels of awareness', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F51.4', 'F50-F59', 'Sleep terrors [night terrors]', '', '', '', '', 'Nocturnal episodes of extreme terror and panic associated with intense vocalization, motility, and high levels of autonomic discharge. The individual sits up or gets up, usually during the first third of nocturnal sleep, with a panicky scream. Quite often', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F51.5', 'F50-F59', 'Nightmares', '', '', '', '', 'Dream experiences loaded with anxiety or fear. There is very detailed recall of the dream content. The dream experience is very vivid and usually includes themes involving threats to survival, security, or self-esteem. Quite often there is a recurrence of', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F51.8', 'F50-F59', 'Other nonorganic sleep disorders', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F51.9', 'F50-F59', 'Nonorganic sleep disorder, unspecified', '', '', '', '', 'Emotional sleep disorder NOS', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F52', 'F50-F59', 'Sexual dysfunction, not caused by organic disorder or diseas', '', 'ers the various ways', '', '', 'Sexual dysfunction covers the various ways in which an individual is unable to participate in a sexual relationship as he or she would wish. Sexual response is a psychosomatic process and both psychological and somatic processes are usually involved in th', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F52.0', 'F50-F59', 'Lack or loss of sexual desire', '', '', '', '', 'Loss of sexual desire is the principal problem and is not secondary to other sexual difficulties, such as erectile failure or dyspareunia. Frigidity Hypoactive sexual desire disorder', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F52.1', 'F50-F59', 'Sexual aversion and lack of sexual enjoyment', '', '', '', '', 'Either the prospect of sexual interaction produces sufficient fear or anxiety that sexual activity is avoided (sexual aversion) or sexual responses occur normally and orgasm is experienced but there is a lack of appropriate pleasure (lack of sexual enjoym', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F52.2', 'F50-F59', 'Failure of genital response', '', 'tile dysfunction (di', '', '', 'The principal problem in men is erectile dysfunction (difficulty in developing or maintaining an erection suitable for satisfactory intercourse). In women, the principal problem is vaginal dryness or failure of lubrication. Female sexual arousal disorder ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F52.3', 'F50-F59', 'Orgasmic dysfunction', '', '', '', '', 'Orgasm either does not occur or is markedly delayed. Inhibited orgasm (male)(female) Psychogenic anorgasmy', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F52.4', 'F50-F59', 'Premature ejaculation', '', '', '', '', 'The inability to control ejaculation sufficiently for both partners to enjoy sexual interaction.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F52.5', 'F50-F59', 'Nonorganic vaginismus', '', 'cles that surround t', '', '', 'Spasm of the pelvic floor muscles that surround the vagina, causing occlusion of the vaginal opening. Penile entry is either impossible or painful. Psychogenic vaginismus', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F52.6', 'F50-F59', 'Nonorganic dyspareunia', '', 'xual intercourse) oc', '', '', 'Dyspareunia (or pain during sexual intercourse) occurs in both women and men. It can often be attributed to local pathology and should then properly be categorized under the pathological condition. This category is to be used only if there is no primary n', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F52.7', 'F50-F59', 'Excessive sexual drive', '', '', '', '', 'Nymphomania Satyriasis', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F52.8', 'F50-F59', 'Other sexual dysfunction, not caused by organic disorder or ', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F52.9', 'F50-F59', 'Unspecified sexual dysfunction, not caused by organic disord', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F53', 'F50-F59', 'Mental and behavioural disorders associated with the puerper', '', '', '', '', 'elsewhere classified This category includes only mental disorders associated with the puerperium (commencing within six weeks of delivery) that do not meet the criteria for disorders classified elsewhere in this chapter, either because insufficient inform', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F53.0', 'F50-F59', 'Mild mental and behavioural disorders associated with the pu', '', '', '', '', 'elsewhere classified Depression: . postnatal NOS . postpartum NOS', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F53.1', 'F50-F59', 'Severe mental and behavioural disorders associated with the ', '', '', '', '', 'not elsewhere classified Puerperal psychosis NOS', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F53.8', 'F50-F59', 'Other mental and behavioural disorders associated with the p', '', '', '', '', 'elsewhere classified', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F53.9', 'F50-F59', 'Puerperal mental disorder, unspecified', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F54', 'F50-F59', 'Psychological and behavioural factors associated with disord', '', 'This category should', '', '', 'diseases classified elsewhere This category should be used to record the presence of psychological or behavioural influences thought to have played a major part in the etiology of physical disorders which can be classified to other chapters. Any resulting', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F55', 'F50-F59', 'Abuse of non-dependence-producing substances', '', '', '', '', 'A wide variety of medicaments and folk remedies may be involved, but the particularly important groups are: (a) psychotropic drugs that do not produce dependence, such as antidepressants, (b) laxatives, and (c) analgesics that may be purchased without med', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F59', 'F50-F59', 'Unspecified behavioural syndromes associated with physiologi', '', '', '', '', 'disturbances and physical factors Psychogenic physiological dysfunction NOS', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F60', 'F60-F69', 'Specific personality disorders', '', '', '', '', 'These are severe disturbances in the personality and behavioural tendencies of the individual; not directly resulting from disease, damage, or other insult to the brain, or from another psychiatric disorder; usually involving several areas of the personal', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F60.0', 'F60-F69', 'Paranoid personality disorder', '', 'usness and a tendenc', '', '', 'Personality disorder characterized by excessive sensitivity to setbacks, unforgiveness of insults; suspiciousness and a tendency to distort experience by misconstruing the neutral or friendly actions of others as hostile or contemptuous; recurrent suspici', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F60.1', 'F60-F69', 'Schizoid personality disorder', '', 'nd introspection. Th', '', '', 'Personality disorder characterized by withdrawal from affectional, social and other contacts with preference for fantasy, solitary activities, and introspection. There is a limited capacity to express feelings and to experience pleasure.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F60.2', 'F60-F69', 'Dissocial personality disorder', '', 'callous unconcern fo', '', '', 'Personality disorder characterized by disregard for social obligations, and callous unconcern for the feelings of others. There is gross disparity between behaviour and the prevailing social norms. Behaviour is not readily modifiable by adverse experience', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F60.3', 'F60-F69', 'Emotionally unstable personality disorder', '', 'definite tendency to', '', '', 'Personality disorder characterized by a definite tendency to act impulsively and without consideration of the consequences; the mood is unpredictable and capricious. There is a liability to outbursts of emotion and an incapacity to control the behavioural', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F60.4', 'F60-F69', 'Histrionic personality disorder', '', '', '', '', 'Personality disorder characterized by shallow and labile affectivity, self-dramatization, theatricality, exaggerated expression of emotions, suggestibility, egocentricity, self-indulgence, lack of consideration for others, easily hurt feelings, and contin', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F60.5', 'F60-F69', 'Anankastic personality disorder', '', 'feelings of doubt, p', '', '', 'Personality disorder characterized by feelings of doubt, perfectionism, excessive conscientiousness, checking and preoccupation with details, stubbornness, caution, and rigidity. There may be insistent and unwelcome thoughts or impulses that do not attain', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F60.6', 'F60-F69', 'Anxious [avoidant] personality disorder', '', '', '', '', 'Personality disorder characterized by feelings of tension and apprehension, insecurity and inferiority. There is a continuous yearning to be liked and accepted, a hypersensitivity to rejection and criticism with restricted personal attachments, and a tend', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F60.7', 'F60-F69', 'Dependent personality disorder', '', '', '', '', 'Personality disorder characterized by pervasive passive reliance on other people to make ones major and minor life decisions, great fear of abandonment, feelings of helplessness and incompetence, passive compliance with the wishes of elders and others, a', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F60.8', 'F60-F69', 'Other specific personality disorders', '', '', '', '', 'Personality (disorder): . eccentric . "haltlose" type . immature . narcissistic . passive-aggressive . psychoneurotic', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F60.9', 'F60-F69', 'Personality disorder, unspecified', '', '', '', '', 'Character neurosis NOS Pathological personality NOS', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F61', 'F60-F69', 'Mixed and other personality disorders', '', 'ty disorders that ar', '', '', 'This category is intended for personality disorders that are often troublesome but do not demonstrate the specific pattern of symptoms that characterize the disorders described in F60.-. As a result they are often more difficult to diagnose than the disor', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F62', 'F60-F69', 'Enduring personality changes, not attributable to brain dama', '', 'us personality disor', '', '', 'Disorders of adult personality and behaviour that have developed in persons with no previous personality disorder following exposure to catastrophic or excessive prolonged stress, or following a severe psychiatric illness. These diagnoses should be made o', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
