('F93', 'F90-F98', 'Emotional disorders with onset specific to childhood', '', 'rends rather than ph', '', '', 'Mainly exaggerations of normal developmental trends rather than phenomena that are qualitatively abnormal in themselves. Developmental appropriateness is used as the key diagnostic feature in defining the difference between these emotional disorders, with', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F93.0', 'F90-F98', 'Separation anxiety disorder of childhood', '', 's differentiated fro', '', '', 'Should be diagnosed when fear of separation constitutes the focus of the anxiety and when such anxiety first arose during the early years of childhood. It is differentiated from normal separation anxiety when it is of a degree (severity) that is statistic', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F93.1', 'F90-F98', 'Phobic anxiety disorder of childhood', '', 'developmental phase ', '', '', 'Fears in childhood that show a marked developmental phase specificity and arise (to some extent) in a majority of children, but that are abnormal in degree. Other fears that arise in childhood but that are not a normal part of psychosocial development (fo', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F93.2', 'F90-F98', 'Social anxiety disorder of childhood', '', '', '', '', 'In this disorder there is a wariness of strangers and social apprehension or anxiety when encountering new, strange, or socially threatening situations. This category should be used only where such fears arise during the early years, and are both unusual ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F93.3', 'F90-F98', 'Sibling rivalry disorder', '', '', '', '', 'Some degree of emotional disturbance usually following the birth of an immediately younger sibling is shown by a majority of young children. A sibling rivalry disorder should be diagnosed only if the degree or persistence of the disturbance is both statis', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F93.8', 'F90-F98', 'Other childhood emotional disorders', '', 's:  gender identity ', '', '', 'Identity disorder Overanxious disorder', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F93.9', 'F90-F98', 'Childhood emotional disorder, unspecified', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F94', 'F90-F98', 'Disorders of social functioning with onset specific to child', '', '', '', '', 'adolescence A somewhat heterogeneous group of disorders that have in common abnormalities in social functioning which begin during the developmental period, but which (unlike the pervasive developmental disorders) are not primarily characterized by an app', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F94.0', 'F90-F98', 'Elective mutism', '', 'The disorder is usua', '', '', 'Characterized by a marked, emotionally determined selectivity in speaking, such that the child demonstrates a language competence in some situations but fails to speak in other (definable) situations. The disorder is usually associated with marked persona', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F94.1', 'F90-F98', 'Reactive attachment disorder of childhood', '', 'lness and hypervigil', '', '', 'Starts in the first five years of life and is characterized by persistent abnormalities in the childs pattern of social relationships that are associated with emotional disturbance and are reactive to changes in environmental circumstances (e.g. fearfuln', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F94.2', 'F90-F98', 'Disinhibited attachment disorder of childhood', '', 'changes in environme', '', '', 'A particular pattern of abnormal social functioning that arises during the first five years of life and that tends to persist despite marked changes in environmental circumstances, e.g. diffuse, nonselectively focused attachment behaviour, attention-seeki', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00');
