('F95', 'F90-F98', 'Tic disorders', '', '', '', '', 'Syndromes in which the predominant manifestation is some form of tic. A tic is an involuntary, rapid, recurrent, nonrhythmic motor movement (usually involving circumscribed muscle groups) or vocal production that is of sudden onset and that serves no appa', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F95.0', 'F90-F98', 'Transient tic disorder', '', '', '', '', 'Meets the general criteria for a tic disorder but the tics do not persist longer than 12 months. The tics usually take the form of eye-blinking, facial grimacing, or head-jerking.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F95.1', 'F90-F98', 'Chronic motor or vocal tic disorder', '', '', '', '', 'Meets the general criteria for a tic disorder, in which there are motor or vocal tics (but not both), that may be either single or multiple (but usually multiple), and last for more than a year.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F95.2', 'F90-F98', 'Combined vocal and multiple motor tic disorder [de la Touret', '', '', '', '', 'A form of tic disorder in which there are, or have been, multiple motor tics and one or more vocal tics, although these need not have occurred concurrently. The disorder usually worsens during adolescence and tends to persist into adult life. The vocal ti', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F95.8', 'F90-F98', 'Other tic disorders', '', '', '', '', '', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F95.9', 'F90-F98', 'Tic disorder, unspecified', '', '', '', '', 'Tic NOS', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F98', 'F90-F98', 'Other behavioural and emotional disorders with onset usually', '', '-defined syndromes b', '', '', 'childhood and adolescence A heterogeneous group of disorders that share the characteristic of an onset in childhood but otherwise differ in many respects. Some of the conditions represent well-defined syndromes but others are no more than symptom complexe', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F98.0', 'F90-F98', 'Nonorganic enuresis', '', 'rized by involuntary', '', '', 'A disorder characterized by involuntary voiding of urine, by day and by night, which is abnormal in relation to the individuals mental age, and which is not a consequence of a lack of bladder control due to any neurological disorder, to epileptic attacks', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F98.1', 'F90-F98', 'Nonorganic encopresis', '', 'r involuntary passag', '', '', 'Repeated, voluntary or involuntary passage of faeces, usually of normal or near-normal consistency, in places not appropriate for that purpose in the individuals own sociocultural setting. The condition may represent an abnormal continuation of normal in', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F98.2', 'F90-F98', 'Feeding disorder of infancy and childhood', '', 'an adequate food sup', '', '', 'A feeding disorder of varying manifestations usually specific to infancy and early childhood. It generally involves food refusal and extreme faddiness in the presence of an adequate food supply, a reasonably competent caregiver, and the absence of organic', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F98.3', 'F90-F98', 'Pica of infancy and childhood', '', '', '', '', 'Persistent eating of non-nutritive substances (such as soil, paint chippings, etc.). It may occur as one of many symptoms that are part of a more widespread psychiatric disorder (such as autism), or as a relatively isolated psychopathological behaviour; o', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F98.4', 'F90-F98', 'Stereotyped movement disorders', '', 'onfunctional (and of', '', '', 'Voluntary, repetitive, stereotyped, nonfunctional (and often rhythmic) movements that do not form part of any recognized psychiatric or neurological condition. When such movements occur as symptoms of some other disorder, only the overall disorder should ', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F98.5', 'F90-F98', 'Stuttering [stammering]', '', 'repetition or prolon', '', '', 'Speech that is characterized by frequent repetition or prolongation of sounds or syllables or words, or by frequent hesitations or pauses that disrupt the rhythmic flow of speech. It should be classified as a disorder only if its severity is such as to ma', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F98.6', 'F90-F98', 'Cluttering', '', 'fluency, but no repe', '', '', 'A rapid rate of speech with breakdown in fluency, but no repetitions or hesitations, of a severity to give rise to diminished speech intelligibility. Speech is erratic and dysrhythmic, with rapid jerky spurts that usually involve faulty phrasing patterns.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('F98.8', 'F90-F98', 'Other specified behavioural and emotional disorders with ons', '', '', '', '', 'occurring in childhood and adolescence Attention deficit disorder without hyperactivity Excessive masturbation Nail-biting Nose-picking Thumb-sucking', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
