('Z61.0', 'Z55-Z65', 'Loss of love relationship in childhood', '', '', '', '', 'Loss of an emotionally close relationship, such as of a parent, a sibling, a very special friend or a loved pet, by death or permanent departure or rejection.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('Z61.1', 'Z55-Z65', 'Removal from home in childhood', '', '', '', '', 'Admission to a foster home, hospital or other institution causing psychosocial stress, or forced conscription into an activity away from home for a prolonged period.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('Z61.2', 'Z55-Z65', 'Altered pattern of family relationships in childhood', '', '', '', '', 'Arrival of a new person into a family resulting in adverse change in childs relationships. May include new marriage by a parent or birth of a sibling.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('Z61.3', 'Z55-Z65', 'Events resulting in loss of self-esteem in childhood', '', '', '', '', 'Events resulting in a negative self-reappraisal by the child such as failure in tasks with high personal investment; disclosure or discovery of a shameful or stigmatizing personal or family event; and other humiliating experiences.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('Z61.4', 'Z55-Z65', 'Problems related to alleged sexual abuse of child by person ', '', '', '', '', 'primary support group Problems related to any form of physical contact or exposure between an adult member of the childs household and the child that has led to sexual arousal, whether or not the child has willingly engaged in the sexual acts (e.g. any g', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('Z61.5', 'Z55-Z65', 'Problems related to alleged sexual abuse of child by person ', '', '', '', '', 'primary support group Problems related to contact or attempted contact with the childs or the other persons breasts or genitals, sexual exposure in close confrontation or attempt to undress or seduce the child, by a substantially older person outside th', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('Z61.6', 'Z55-Z65', 'Problems related to alleged physical abuse of child', '', '', '', '', 'Problems related to incidents in which the child has been injured in the past by any adult in the household to a medically significant extent (e.g. fractures, marked bruising) or that involved abnormal forms of violence (e.g. hitting the child with hard o', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('Z61.7', 'Z55-Z65', 'Personal frightening experience in childhood', '', '', '', '', 'Experience carrying a threat for the childs future, such as a kidnapping, natural disaster with a threat to life, injury with a threat to self-image or security, or witnessing a severe trauma to a loved one.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
