('Z62.0', 'Z55-Z65', 'Inadequate parental supervision and control', '', '', '', '', 'Lack of parental knowledge of what the child is doing or where the child is; poor control; lack of concern or lack of attempted intervention when the child is in risky situations.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('Z62.1', 'Z55-Z65', 'Parental overprotection', '', '', '', '', 'Pattern of upbringing resulting in infantilization and prevention of independent behaviour.', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('Z62.2', 'Z55-Z65', 'Institutional upbringing', '', '', '', '', 'Group foster care in which parenting responsibilities are largely taken over by some form of institution (such as residential nursery, orphanage, or childrens home), or therapeutic care over a prolonged period in which the child is in a hospital, convale', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
('Z62.3', 'Z55-Z65', 'Hostility towards and scapegoating of child', '', '', '', '', 'Negative parental behaviour specifically focused on the child as an individual, persistent over time and pervasive over several child behaviours (e.g. automatically blaming the child for any problems in the household or attributing negative characteristic', 0, 0, '', '0000-00-00 00:00:00', '', '0000-00-00 00:00:00'),
